import React from 'react';
import WelcomePage from './components/WelcomeSection/WelcomePage';
import LoginForm from './components/LoginForm/LoginForm';
import './style.css';


 class App extends React.Component() {

   render(){
    return(
        <div className='App'>
            <LoginForm></LoginForm>
        <WelcomePage></WelcomePage>
        </div>
    ); 
    }

}
export default App;
